CREATE TABLE ppstat.students
(
    id int(10) unsigned PRIMARY KEY NOT NULL AUTO_INCREMENT,
    imie varchar(255) NOT NULL,
    drugie_imie varchar(255) NOT NULL,
    nazwisko varchar(255) NOT NULL,
    imie_ojca varchar(255) NOT NULL,
    liczba_punktow double(8,2) NOT NULL,
    jedna_gwiazdka tinyint(1) NOT NULL,
    dwie_gwiazdki tinyint(1) NOT NULL,
    wydzial_short varchar(255) NOT NULL,
    kierunek_short varchar(255) NOT NULL,
    kierunek_id int(11) NOT NULL,
    created_at timestamp,
    updated_at timestamp
);
